import { createGlobalStyle } from "styled-components";

export default createGlobalStyle`
    * {
        margin: 0;
        padding: 0;
        outline: 0;
        box-sizing: border-box;
    }
    html, body, #root {
        height: 100%;
        background-color: #eee; 
    }
    ul {
        list-style: none;
        li {
            cursor: pointer;
        }
    }
`;
